import React from 'react';

const Accordion = ({ items }) => {
    const accItems = items.map(item => {
        return (
            <div>
                <div className='title active'>
                    <i className='dropdown icon'></i>
                    {item.title}
                </div>
            </div>
        )
    });
    return (
        <div>{items.length}</div>
    )
};

export default Accordion;
